import { base_url } from "../config";

const Blocks = {
  gallery: () => {
    return fetch(`${base_url}/gallery`).then((res) => res.json());
  },
  gameplay: () => {
    return fetch(`${base_url}/gameplay`).then((res) => res.json());
  },
  recommendation: () => {
    return fetch(`${base_url}/recommendation`).then((res) => res.json());
  },
  newgame: () => {
    return fetch(`${base_url}/newgame`).then((res) => res.json());
  },
};

export default Blocks;
